// create router for users

const express = require('express');
const router = express.Router();
const userController = require('../controllers/userController');
const passportJWT = require('../middleware/passportJWT');

/**
 * @swagger
 * tags:
 *   name: Users
 *   description: User management
 */

/**
 * @swagger
 * /users:
 *   post:
 *     summary: Create a new user
 *     tags: [Users]
 *     requestBody:
 *       required: true
 *       content:
 *         application/json:
 *           schema:
 *             type: object
 *             properties:
 *               first_name:
 *                 type: string
 *                 example: "Worapakorn6"
 *               last_name:
 *                 type: string
 *                 example: "Jarusiriphot6"
 *               username:
 *                 type: string
 *                 example: "WOJA6"
 *               password:
 *                 type: string
 *                 example: "111111"
 *               email:
 *                 type: string
 *                 example: "Worapakorn6@gmail.com"
 *               birthday:
 *                 type: string
 *                 format: date
 *                 example: "2003-03-17"
 *               phone_number:
 *                 type: string
 *                 example: "0623844415"
 *               gender:
 *                 type: string
 *                 example: "ชาย"
 *               user_image:
 *                 type: string
 *                 example: "data:image/jpeg;base64,"
 *     responses:
 *       201:
 *         description: The user was successfully created
 *       400:
 *         description: Invalid input
 */
router.post('/', userController.create);

/**
 * @swagger
 * /users:
 *   get:
 *     summary: Retrieve all users
 *     tags: [Users]
 *     responses:
 *       200:
 *         description: A list of users
 *         content:
 *           application/json:
 *             schema:
 *               type: array
 *               items:
 *                 type: object
 *                 properties:
 *                   users_id:
 *                     type: string
 *                   first_name:
 *                     type: string
 *                   last_name:
 *                     type: string
 *                   username:
 *                     type: string
 *                   email:
 *                     type: string
 *                   birthday:
 *                     type: string
 *                     format: date
 *                   phone_number:
 *                     type: string
 *                   gender:
 *                     type: string
 *                   user_image:
 *                     type: string
 */
router.get('/', userController.findAll);

/**
 * @swagger
 * /users/{id}:
 *   get:
 *     summary: Retrieve a single user by ID
 *     tags: [Users]
 *     parameters:
 *       - in: path
 *         name: id
 *         schema:
 *           type: string
 *         required: true
 *         description: The user ID
 *         example: "39fb4df4-05c4-4be4-8777-351a9bce42e5"
 *     responses:
 *       200:
 *         description: A user object
 *         content:
 *           application/json:
 *             schema:
 *               type: object
 *               properties:
 *                 users_id:
 *                   type: string
 *                 first_name:
 *                   type: string
 *                 last_name:
 *                   type: string
 *                 username:
 *                   type: string
 *                 email:
 *                   type: string
 *                 birthday:
 *                   type: string
 *                   format: date
 *                 phone_number:
 *                   type: string
 *                 gender:
 *                   type: string
 *                 user_image:
 *                   type: string
 *       404:
 *         description: User not found
 */
router.get('/:id', [passportJWT.isLogin], userController.findOne);

/**
 * @swagger
 * /users/{id}:
 *   put:
 *     summary: Update a user with id
 *     tags: [Users]
 *     parameters:
 *       - in: path
 *         name: id
 *         schema:
 *           type: string
 *         required: true
 *         description: The user ID
 *         example: "39fb4df4-05c4-4be4-8777-351a9bce42e5"
 *     requestBody:
 *       required: true
 *       content:
 *         application/json:
 *           schema:
 *             type: object
 *             properties:
 *               first_name:
 *                 type: string
 *                 example: "Worapakorn1000"
 *               last_name:
 *                 type: string
 *                 example: "Jarusiriphot1000"
 *               username:
 *                 type: string
 *                 example: "WOJA1000"
 *               password:
 *                 type: string
 *                 example: "123456"
 *               email:
 *                 type: string
 *                 example: "Worapakorn1000@gmail.com"
 *               birthday:
 *                 type: string
 *                 format: date
 *                 example: "2006-04-13"
 *               phone_number:
 *                 type: string
 *                 example: "0818144499"
 *               gender:
 *                 type: string
 *                 example: "หญิง"
 *               user_image:
 *                 type: string
 *                 example: "data:image/jpeg;base64,"
 *     responses:
 *       200:
 *         description: User was updated successfully.
 *       404:
 *         description: User not found
 *       400:
 *         description: Invalid input
 */
router.put('/:id', [passportJWT.isLogin], userController.update);

/**
 * @swagger
 * /users/{id}:
 *   delete:
 *     summary: Delete a user with id
 *     tags: [Users]
 *     parameters:
 *       - in: path
 *         name: id
 *         schema:
 *           type: string
 *         required: true
 *         description: The user ID
 *         example: "39fb4df4-05c4-4be4-8777-351a9bce42e5"
 *     responses:
 *       200:
 *         description: User was deleted successfully.
 *       404:
 *         description: User not found
 */
router.delete('/:id', userController.delete);

/**
 * @swagger
 * /users:
 *   delete:
 *     summary: Delete all users
 *     tags: [Users]
 *     responses:
 *       200:
 *         description: All users were deleted successfully.
 */
router.delete('/', userController.deleteAll);

module.exports = router;
